import axios from 'axios';
import React,{useEffect, useState} from 'react';
import base_url from '../../api/bootapi';


const List=(props)=>{
    const [workAmt, setWorkAmt]=useState("");
    const [workDesc, setWorkDesc]=useState("");
    const [city, setCity]=useState("");
    const [cat, setCat]=useState("");

    useEffect(()=>{
        getDataFromServer();
    },[]);

    const getDataFromServer=()=>{
        axios.get(`${base_url}/user/workDetails/`).then(
            (response)=>{
                console.log(response.data);
                setWorkAmt(response.data.workAmount);
                setWorkDesc(response.data.description);
                setCity(response.data.location);
                setCat(response.data.category);
            },(error)=>{
                console.log(error);
            }
        )
    };

    return(
        <div>
            <p>{workAmt}</p>
            <p>{workDesc}</p>
            <p>{city}</p>
            <p>{cat}</p>
        </div>
    )
}
export default List;
